import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <footer style={{ textAlign: "center" }}>
        <p>
          Louis Yacksmith
          <br />
          louisyacksmith@hotmail.com
          <br />
          Ottawa, Ontario
        </p>
      </footer>
    );
  }
}

export default Footer;
